# In a nutshell

### Motivation

- Housing markets deepen and structure economic inequalities .cyan[.font70[(Ansell 2019; Baldenius et al. 2019)]]
- Extensive research on the effects of subnational housing marketson the demand-side .cyan[.font70[(e.g., Larsen et al. 2019; Ansell et al. 2022; Cohen 2022)]]
- .cyan[However:] We know little about their effects on the supply-side politicization of housing policy supply-side .cyan[.font70[(but see Ansell et al., in progress)]] -- and nothing about these in renter-majority countries

--

### What do we do in this paper?

- Study MPs' strategic responses to housing markets in their electoral districts in Germany
- Argue that MPs deviate from party's platforms via 'selective emphasis', not 'direct confrontation'
- Use a novel framework for salience and position estimation based on MPs' tweets
- Combine these with georeferenced housing ads and small-area census and administrative data
- Test our argument in cross-sectional + longitudinal perspectives

---

# Theoretical framework

---

# Strategic dilemmas of dyadic representation

In territorial representation systems, MPs face competing principals .cyan[.font70[(Carey 2007)]]
- Their national party
- Their local constituents
    
--

When principals' interest diverge, parties and MPs face a .cyan[strategic dilemma]
- Electoral benefits of responsiveness to constituency demands (dyadic representation)
- Organizational and electoral costs of jeopardizing party unity
    
--

Existing research studies both sides of this trade-off:
- MPs build personal platforms and engage in dyadic representation .cyan[.font70[(e.g., Baumann et al. 2015; Geschwend and Zittel 2015; Hanretty et al. 2017; Schwarz et al. 2017; Zittel et al. 2019)]]
- Party whips and selectorates sanction deviations from the party line .cyan[.font70[(e.g., BÃ¤ck and Debus 2018; Baumann et al. 2017; Proksch and Slapin 2012, Rehmert 2020)]]

---

# Dyadic representation of housing policy preferences

#### General mechanisms of representing local interests

The existing literature has primarily focused on two in analyzing legislators responses to local interests:

1. .cyan[Salience:] Legislators respond to (median) local policy priorities .cyan[.font70[(e.g., Soroka et al. 2009; Baumann 2016; DÃ¤ubler 2020)]]
1. .cyan[Positions:] Legislators respond to (median) local policy preferences  .cyan[.font70[(e.g., Baumann et al. 2015; Hanretty et al. 2017; Schwarz et al. 2017)]]

--

#### Subnational

   

---

# Direct confrontation vs selective emphasis

#### Argument

Like parties, MPs' can build distinct platforms via different mechanisms .cyan[.font70[(cf. Downs 1957, Budge and Farlie 1983a,b)]]:
  - 'Direct confrontation': MPs support (oppose) policies their party opposes (supports)
  - 'Selective emphasis': MPs emphasize those policies of their party that are electorally opportune
    
--

#### Direct confrontation

- Strategic dilemma: Representation-unity trade-off due to policy disagreement
- Risks rifts between parties and MPs, particularly so on polarized issues (where opposing party's stance = supporting competitor's stance)

--

#### Selective emphasis

- Avoids .cyan[genuine] positional confrontation between parties and MP `\(\rightarrow\)` No policy disagreements
- MPs build a personal platform by 'choosing from their party's menu' to their constituents' liking

---

# Expectations

- Higher .cyan[salience] of housing policy in districts with high rent-to-income ratios

--

- &lt;details&gt;&lt;summary&gt;Due to unambiguous party platforms and high issue polarization, we expect no .cyan[genuine] positional deviations in response to rent-to-income ratios&lt;/summary&gt;
&lt;img src="epsa_presentation_files/figure-html/policy-dimensions-1.png" width="100%" style="display: block; margin: auto;" /&gt;
&lt;/details&gt;

--

- Instead, .cyan[implicit] positional diversification via .cyan[selective emphasis] in high-pressured markets:
    - Left-wing MPs will emphasize left positions on market control policies
    - Right-wing MPs will emphasize right positions on supply-side subsidies

---

class: inverse, mline, center, middle

# Empirical strategy

---

# Legislator-level salience and position scores

1. &lt;details&gt;&lt;summary&gt;Annotation of 3000 keyword-filtered tweets (1347 true positives)&lt;/summary&gt;
&lt;img src="epsa_presentation_files/figure-html/annotation-plot-1.png" width="100%" style="display: block; margin: auto;" /&gt;
&lt;/details&gt;

--

2. Fine-tuning of BERT

--

3. &lt;details&gt;&lt;summary&gt;Classification of tweets as being about (1) market control, (2) supply-side subsides, (3) both, or (4) neither)&lt;/summary&gt;
&lt;img src="epsa_presentation_files/figure-html/prediction-plot-1.png" width="70%" style="display: block; margin: auto;" /&gt;
&lt;/details&gt;

--

4. Classification of tweets in (1)-(3) as left (-1), right (+1), or neutral (0)

--

5. Prediction and inference via Bayesian hierarchical multinomial models with legislator + district REs

- Aggregations of 2017 square meter base rents, based on millions of geo-referenced housing ads
- Multiplied by district-level average home size per capita (in sqm) from the 2011 census
- Divided by district-level average net incomes from administrative statistics

--

### Other covariates

1. Party fixed effects
1. Spokesperson of parliamentary group for housing
1. Role in committee for Construction, Housing, and Development (none/deputy/member/leading)
1. District winner $\times$ margin of loss/victory
1. District-level homeownership rates
1. District-level log population density
1. Competed in Eastern/Western district

---

### Models

- Salience and positions as a function of rent-to-income ratios
- Focus on intra-party effects (deviations from the party line)
    1. Pooled model: All policy domains, all parties
    2. Disaggregated models: Market control and supply side subsidies by left-wing/right-wing parties

# Summary and outlook

---

# Summary

We have:

- presented a novel argument and preliminary evidence of the subnational diversification of housing policy supply

--

- moved beyond existing literature on (dyadic) representation by integrating mechanisms of platform building from the party competition literature

--

- shown that MPs use .cyan[selective emphasis], not .cyan[direct confrontation], to cater for constituents' interests

--

- shown that this holds especially for left-wing MPs' emphasis on pro-market control statements in response to high-pressured district housing markets

---

# Implications

- Partisanship trumps dyadic representation
    - MPs do not turn their backs on their parties to side with the district-level median voter
    - At best, they (de)emphasize (un)popular positions

--
    
- This has several implications for the future of housing policy:
    - Cross-camp coalitions are unlikely to settle on policy compromises
    - National-level same-camp coalitions will likely be internally divided over enacting policies
    - Subnational same-camp coalition will likely be unified (but may lack the legislative power)
    
--

- The result is a persistence of the status quo at worst or piecemeal legislation of new policy instruments at best

--

- Market failures and public grievances will only be addressed when the public is sufficiently and homogeneously unified
